&lt;p&gt;
					The Sport &amp;amp; Recreation Spatial project provides a national geographic information system (GIS) for presenting spatial data relevant to all levels of the sport and recreation sector. This will provide the sport and recreation sector with increased capacity for research, strategic planning, and development of participation programs and facilities.&lt;/p&gt;
				&lt;p&gt;
					Key areas:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						Participation levels and trends&lt;/li&gt;
					&lt;li&gt;
						Influences on participation&lt;/li&gt;
					&lt;li&gt;
						Value of sport: the health benefits of participation&lt;/li&gt;
					&lt;li&gt;
						Places to play: the nexus between facilities and participation&lt;/li&gt;
				&lt;/ul&gt;

&lt;p&gt;
					FedUni Spatial is an interoperable web-GIS. The impetus for the project was to provide the most relevant and current Natural Resource Management (NRM) data into an environment where it can be shared with and accessed by catchment managers, researchers, consultants, municipalities, government agencies and members of the general public.&lt;/p&gt;
				&lt;p&gt;
					FedUni Spatial was initially established as a collaborative project between the &lt;a href="http://www.ccma.vic.gov.au" target="_blank"&gt;Corangamite Catchment Management Authority&lt;/a&gt; (CMA) and the &lt;a href="http://www.federation.edu.au" target="_blank"&gt;Federation University Australia&lt;/a&gt; (UB).&lt;/p&gt;
				&lt;p&gt;
					FedUni Spatial countains four datasets&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						groundwater bores&lt;/li&gt;
					&lt;li&gt;
						salinity&lt;/li&gt;
					&lt;li&gt;
						erosion&lt;/li&gt;
					&lt;li&gt;
						landslides&lt;/li&gt;
				&lt;/ul&gt;

&lt;p&gt;
					The Gippsland Local Government Network has identified GIS as a priority application for the GippsLink Shared ICT Services Project.&amp;nbsp; During January 2010, CeCC was engaged by the Department of Innovation, Industry and Regional Development to assist in researching the business case for the GIS application.&amp;nbsp; Associated research was completed during May 2010.&lt;/p&gt;
				&lt;p&gt;
					The overall vision is for participating Local Government Areas (LGAs) to have access to a wide range of GIS tools, comprehensive data resources and well developed business systems that together are capable of providing them with the capabilities required to support well informed regional decision making, planning, monitoring and reporting.&lt;/p&gt;
				&lt;p&gt;
					The participating LGAs were Bass Coast Shire; Baw Baw Shire; East Gippsland Shire; Latrobe City; South Gippsland Shire, Wellington Shire.&lt;/p&gt;

&lt;p&gt;Acted Facial Expressions in the Wild (AFEW) is a dynamic temporal facial expressions data corpus consisting of close to real world environment extracted from movies. It has been developed by selecting frames from AFEW.&lt;/p&gt;
				&lt;p&gt;Quality data recorded in varied realistic environments is vital for effective human face related research. Currently available datasets for human facial expression analysis have been generated in highly controlled lab environments.&lt;/p&gt;
				&lt;p&gt;We present a new static facial expression database Static Facial Expressions in the Wild (SFEW) extracted from a temporal facial expressions database Acted Facial Expressions in the Wild (AFEW), which we have extracted from movies. In the past, many robust methods have been reported in the literature. However, these methods have been experimented on different databases or using different protocols within the same databases. The lack of a standard protocol makes it difficult to compare systems and acts as a hindrance in the progress of the field.&lt;/p&gt;

&lt;p&gt;
									A long running project the commenced in the UK at City University in 1986 was around methods for extracting features from images. It was funded as part of an Advanced Research Fellowship for Geoff West, and a PhD scholarship and externally funded research fellowship for Paul Rosin. Both came to Curtin University as academics in 1990 and continued the research until 1996 involving research and honours students. The feature extraction was generic in nature and was used in a number of projects. A number of papers were published from the research.&lt;/p&gt;&#13;
								  &lt;p&gt;
									Extraction of features from images is an ongoing process that commenced in the early 1960s. It is still being actively researched by many around the world. It is a fundamental technique needed for a large number of different applications including measurement, photogrammetry, robotic guidance, image interpretation, autonomous cars, object recognition and surveillance.&lt;/p&gt;
